import React from "react"
function Product(props){
    return(
           <div>
               <h1>{props.product.name}</h1>
               <p>{props.product.price.toLocalString("en-US",{style:"currency",currency:"USD"})}-{props.product.description}</p>
           </div>
    )
}
export default Product
